pragma solidity ^0.6.0;
pragma experimental ABIEncoderV2;


contract Test {
    uint256 number;
    uint256[] public ids;
    string public testName = "This is a test";
    uint public count;
    constructor() public{
        count = 0;
    }
    struct Election {
        uint256 id;
        string name;
    }
    Election[] public elections;
    uint256 public nextId = 1;

    event ElectionResult(
        uint count
    );

    function eventCount() external{
        count++;
        emit ElectionResult(count);
    }

    function getAllElections() public view returns (Election[] memory) {
        return elections;
    }

    function create(string memory name) public {
        elections.push(Election(nextId, name));
    }

    function read(uint256 id) public view returns (uint256, string memory) {
        uint256 i = find(id);
        return (elections[i].id, elections[i].name);
    }

    function update(uint256 id, string memory name) public {
        uint256 i = find(id);
        elections[i].name = name;
    }

    function destroy(uint256 id) public {
        for (uint256 i = id; i < elections.length - 1; i++) {
            elections[i] = elections[i + 1];
        }
        elections.pop();
    }

    function find(uint256 id) internal view returns (uint256) {
        for (uint256 i = 0; i < elections.length; i++) {
            if (elections[i].id == id) {
                return i;
            }
        }
        revert("Election does not exist!");
    }

    function add(uint256 id) public {
        ids.push(id);
    }

    function get(uint256 position) public view returns (uint256) {
        return ids[position];
    }

    function getAll() public view returns (uint256[] memory) {
        return ids;
    }

    function length() public view returns (uint256) {
        return ids.length;
    }

    function hello() public pure returns (string memory) {
        return "Hello World!";
    }

    function store(uint256 num) public {
        number = num;
    }

    function getNumber() public view returns (uint256) {
        return number;
    }
}
